import React from 'react';

//--------------------------------------------------------
import SwapiService from '../../Services/swapi-service';


//--------------------------------------------------

import './itom-list.css';

export default class ItomList extends React.Component {

state= {
   list:[]
}

componentDidMount(){
   this.getAllItomList();
}

getAllItomList = () => {
const swapi = new SwapiService();
swapi.getAllPeople().then((rez)=>{
   this.setState({list:rez});
});
console.log(this.state.list);
}

render(){ 
 //  const {usinItem} = this.props;
   let count =1; 
   const element = this.state.list.map((el)=>{
               const id = count++;
               const {name, eye_color} = el;
               return (
                   <li key ={id} className="btn-zeal"
                       // onClick={()=>usinItem(id,type)}
                       >{name} and {eye_color}</li>
               );
    });

   return(
          <ul className = "itom-list list-group-item">
             {element}
         </ul>
   );
};
};
